/* Diseñar y crear una tabla llamada "credit_card" que almacene detalles cruciales sobre las tarjetas de crédito. 
La nueva tabla debe ser capaz de identificar de forma única cada tarjeta y establecer una relación adecuada con las otras dos tablas 
("transaction" y "company"). 
Después de crear la tabla será necesario que ingreses la información del documento denominado "datos_introducir_credit". 
Recuerda mostrar el diagrama y realizar una breve descripción del mismo. */

-- creamos la tabla credit card
CREATE TABLE credit_card (
id VARCHAR(20) PRIMARY KEY, 
iban VARCHAR(50),
pan INT, 
pin VARCHAR(4), 
cvv INT, 
expiring_date VARCHAR(20)
);

-- visualizamos las caracteristicas de la tabla 'credit_card'
DESC credit_card; 

ALTER TABLE credit_card
MODIFY COLUMN pan VARCHAR(50);

-- Insertamos datos de credit_card

-- relacionamos la tabla 'credit_card' con la tabla 'transaction' haciendo llave foranea el campo 'credit_card_id' de la tabla 'transaction' 
ALTER TABLE transaction 
ADD CONSTRAINT fk_transaction_to_creditcard
FOREIGN KEY (credit_card_id) REFERENCES credit_card(id)
ON DELETE SET NULL;

-- consultamos las caracteristicas de la tabla despues de la creación de la FK.
DESC transaction;

