-- Nivel 2
-- Ejercicio 2
-- crear la vista 'VistaMarketing' con: Nombre de la compañía, Teléfono de contacto, País de residencia, Media de compra realizado por cada compañía

-- creamos la vista
CREATE OR REPLACE VIEW VistaMarketing AS
SELECT c.company_name, c.phone, c.country, ROUND (AVG(t.amount), 2) AS purchase_average
FROM company AS c
LEFT JOIN transaction AS t
ON c.id = t.company_id
GROUP BY c.company_name, c.phone, c.country
ORDER BY purchase_average DESC;

-- consulto la vista creada
SELECT * 
FROM vistamarketing;

