-- Ejercicio 1

-- crear la tabla 'user'
CREATE TABLE IF NOT EXISTS user (
	id CHAR(10) PRIMARY KEY,
	name VARCHAR(100),
	surname VARCHAR(100),
	phone VARCHAR(150),
	email VARCHAR(150),
	birth_date VARCHAR(100),
	country VARCHAR(150),
	city VARCHAR(150),
	postal_code VARCHAR(100),
	address VARCHAR(255)    
);

-- insertamos los datos en la tabla 'user'

-- actualizamos el nombre de la tabla 'user' a 'data_user'
RENAME TABLE user TO data_user;

-- alteramos el tipo del campo 'id' de la tabla 'data_user' para que coincida con el tipo del campo 'user_id' de la tabla 'transaction'
ALTER TABLE data_user
MODIFY COLUMN id INT;

-- consultamos cuántos 'id' hay en la tabla 'data_user'
SELECT COUNT(id) AS cantidad_usuarios
FROM data_user;

-- consultamos cuantos 'user_id' hay en la tabla 'transaction'
SELECT COUNT(DISTINCT t.user_id) AS cantidad_usuarios_transaction
FROM transaction AS t;

-- consultamos el 'id' que solo aparece en la tabla 'transaction'
SELECT t.user_id
FROM transaction AS t
WHERE t.user_id NOT IN 
		(
			SELECT id
			FROM data_user AS d
		)
;

