-- Nivel 3
-- Ejercicio 2
-- crear una vista llamada "InformeTecnico" 
/* o	ID de la transacción
o	Nombre del usuario/a
o	Apellido del usuario/a
o	IBAN de la tarjeta de crédito usada.
o	Nombre de la compañía de la transacción realizada.
*/

-- creamos la vista Informe_Tecnico
CREATE VIEW Informe_Tecnico AS
	SELECT t.id AS transaction_id, d.name AS user_name, d.surname AS user_surname, d.country AS user_country,
    cc.iban, c.company_name, c.country AS company_country, t.amount AS purchase_amount
	FROM transaction AS t
	LEFT JOIN data_user AS d
	ON t.user_id = d.id
	LEFT JOIN credit_card AS cc
	ON t.credit_card_id = cc.id
	LEFT JOIN company AS c
	ON t.company_id = c.id
;

-- consultamos la vista Informe_Tecnico y ordenamos la consulta de maior a menor por el campo transaction
SELECT *
FROM informe_tecnico
ORDER BY transaction_id DESC;






